package internal

import (
	"bufio"
	"encoding/base64"
	"errors"
	"github.com/techoner/gophp"
	"io/ioutil"
	"log"
	"os"
	"strconv"
	"strings"
)

func GetSocketInfoInt(token string) int {
	if _, err := os.Stat("/etc/artica-postfix/settings/Daemons/" + token); errors.Is(err, os.ErrNotExist) {
		return 0
	}
	tk, err := os.ReadFile("/etc/artica-postfix/settings/Daemons/" + token)
	if err != nil {
		return 0
	}

	tkint, _ := strconv.Atoi(string(tk))

	return tkint
}

func GetSocketInfoBool(token string) bool {
	if _, err := os.Stat("/etc/artica-postfix/settings/Daemons/" + token); errors.Is(err, os.ErrNotExist) {
		return false
	}
	tk, err := os.ReadFile("/etc/artica-postfix/settings/Daemons/" + token)
	if err != nil {
		return false
	}

	boolValue, err := strconv.ParseBool(string(tk))
	if err == nil {
		return boolValue
	}

	return false
}

func GetSocketInfoString(token string) string {
	if _, err := os.Stat("/etc/artica-postfix/settings/Daemons/" + token); errors.Is(err, os.ErrNotExist) {
		return ""
	}
	tk, err := os.ReadFile("/etc/artica-postfix/settings/Daemons/" + token)
	if err != nil {
		return ""
	}

	return string(tk)
}

func SetSocketInfo(token string, value string) {
	_, err := os.OpenFile("/etc/artica-postfix/settings/Daemons/"+token, os.O_APPEND|os.O_CREATE|os.O_WRONLY, 0755)
	if err != nil {
		log.Fatal(err)
	}
	err1 := ioutil.WriteFile("/etc/artica-postfix/settings/Daemons/"+token, []byte(value+"\n"), 0755)
	if err1 != nil {
		log.Fatal(err1)
	}

}

func GetArticaLicense() bool {
	//Check Gold License
	gold, _ := os.Open("/usr/local/share/artica/.GOLD")

	defer gold.Close()

	scannerGold := bufio.NewScanner(gold)

	for scannerGold.Scan() {
		fdata := strings.TrimSpace(scannerGold.Text())
		if len(fdata) == 0 {
			return false
		}
		if fdata == "TRUE" {
			return true
		}
		str := ""
		base64decoded, _ := base64.StdEncoding.DecodeString(str)
		out, _ := gophp.Unserialize([]byte(base64decoded))

		if mout, ok := out.(map[string]interface{}); ok {

			if _, ok := mout[fdata].(map[string]interface{}); ok {
				return true
			}
			return false
		}

	}

	//Check Corporate License
	isArticaLicense := GetSocketInfoInt("isArticaLicense")
	if isArticaLicense == 1 {
		return true
	}
	corp, _ := os.Open("/etc/artica-postfix/settings/Daemons/CORP_LICENSE")

	defer corp.Close()

	scannerCorp := bufio.NewScanner(corp)

	for scannerCorp.Scan() {
		fdata := strings.TrimSpace(scannerCorp.Text())
		if len(fdata) == 0 {
			return false
		}

		if fdata == "VFJVRQ==" {
			return true
		}
		return false

	}

	return false
}

func IsInt(s string) bool {
	_, err := strconv.Atoi(s)
	return err == nil
}
